import { React } from "react";
import "./Board.css";
import PostBox from "./postBox";
//PostBox를 그려줍니다.
function PostList({ postList }) {
  console.log(postList);
  return (
    <div>
      {postList &&
        postList.map((post) => (
          <PostBox postList={post} key={`calendar-week-${post.id}`} />
        ))}
    </div>
  );
}
export default PostList;
